To determine the area of the field excluding the track, we need to follow these steps:

1. **Calculate the area of the entire rectangular field.**

   The length of the field is given as 400 meters. Let the width of the field be \( w \) meters. Therefore, the area of the entire field is:
   \[
   \text{Area of the field} = 400 \times w
   \]

2. **Determine the dimensions of the inner rectangle after the track is built.**

   The trackwalking track covers the entire length of the field and two semicircles at each end. Each semicircle has a radius equal to half the width of the field, which is \( \frac{w}{2} \). Therefore, the total width of the track is the width of the field minus the width of the two semicircles:
   \[
   \text{Width of the inner rectangle} = w - 2 \times \frac{w}{2} = w - w = 0
   \]
